const items = [
    {
        title: 'Ola',
        link: '',
    },
    {
        title: '2',
        link: '',
    },
    {
        title: '3',
        link: '',
    },
];

const getSidebarItems = (classes) => {
    return (
        items.map((item, index) => (
            <a href={item.link} className={classes.sidebarContentListItem} key={index}>
                <li>
                    {item.title}
                </li>
            </a>
        ))
    );
};

export default getSidebarItems;
